-- verificacion de carga masiva a tabla ficha_desarrollo
select fila,* from nasca.ficha_desarrollo

-- conteo de los estados de conexion
select estado_conexion, count(estado_conexion)
from nasca.ficha_desarrollo
group by estado_conexion

-- añadir columna fila a tabla ficha
alter table nasca.ficha add column fila integer

-- add sequence al fila (solo en produccion)
create sequence nasca.ficha_id_seq
-- asignar la secuencia
alter table nasca.ficha alter column id set default nextval('ficha_id_seq');

